public class App {
    public String getGreeting() {
        return "Hello world.";
    }

    public static void main(String[] args) {
        System.out.println(new App().getGreeting());
        change(100000);
    }

    private static long change(long n){
        long returnValue = 0L;
        for ( long i = 0; i<n; i++){
            for (long j = 0; j<i; j++){
                returnValue = returnValue+i*j;
            }
        }
        return returnValue;
    }
}
